import { response } from 'express';
import react,{useEffect, useState} from 'react';
import './App.css';

function App() {
  const [backendData, setBackendData] = useState ([{}])
  useEffect(()=>{
    fetch("/api").then(
      response => response.json()
    ).then(
      data =>{
        setBackendData(data)
      }
    )
  }), []
  return (
    <div className="App">

    </div>
  );
}

export default App;
